<link rel="preconnect" href="https://fonts.googleapis.com">
    <link rel="preconnect" href="https://fonts.gstatic.com" crossorigin>
    <link
        href="https://fonts.googleapis.com/css2?family=Lato:ital,wght@0,100;0,300;0,400;0,700;0,900;1,100;1,300;1,400;1,700;1,900&display=swap"
        rel="stylesheet">
    <link href="https://cdn.jsdelivr.net/npm/bootstrap@5.3.2/dist/css/bootstrap.min.css" rel="stylesheet">
    <script src="https://cdn.jsdelivr.net/npm/bootstrap@5.3.2/dist/js/bootstrap.bundle.min.js"></script>
 <style>
        *,
        h1,
        h2,
        h3,
        h4,
        h5 {
            font-family: Lato !important;
			letter-spacing: normal;
        }

        select,
        textarea,
        option {
            border: none;
            margin-bottom: 5px;
        }

        section {
            width: 100%;
        }

        .block {
            display: block;
        }

        .btn {
            border-radius: 6px;
            background: #FFF;
            padding: 10px 20px;
            text-decoration: none;
            color: #0E1759;

        }

        .btn:hover {
            border-radius: 6px;
            background: #22BDFF;
            padding: 10px 20px;
            text-decoration: none;
            color: #fff;

        }

        .btnB {
            border-radius: 6px;
            background: linear-gradient(270deg, #0220FC -19.13%, #1168FD 39.12%, #22BDFF 98.02%);
            padding: 10px;
            text-decoration: none;
            color: #FFF;
            display: flex;
            align-items: center;
            gap: 5px;
            width: fit-content;
            font-weight: 900;
			border: none;
        }

        .btnB:hover {
            border-radius: 6px;
            background: linear-gradient(270deg, #0220FC -19.13%, #1168FD 39.12%, #22BDFF 98.02%);
            padding: 15px;
            text-decoration: none;
            color: #FFF;
            display: flex;
            align-items: center;
            gap: 5px;
            width: fit-content;
        }

        .btnG {
            border-radius: 6px;
            background: #E9EAF0;
            padding: 10px 20px;
            text-decoration: none;
            color: #0E1759;
            font-weight: 800;
        }

        .btnG:hover {
            background: #C9CAD0;
            color: #1E2769;

        }

        .btnL {
            border-radius: 16px;
            border: #FFF solid 1px;
            background-color: transparent;
            color: #fff;
            padding: 5px 25px;
            text-decoration: none;
        }

        .btnL:hover {
            background-color: #fff;
            color: #000;
        }

        .card {
            border-radius: 11px;
            background: #FFF;
            color: #0E1759;
            text-align: center;
            width: 300px;
            padding: 15px 5px;
            box-shadow: none;
        }

        .card a {
            border-radius: 6px;
            background: #22BDFF;
            color: #FFF;
            text-decoration: none;
            padding: 5px 10px;
            width: fit-content;
            margin: auto;
            font-weight: 800;
        }

        .card a:hover {
            background: #129DDF;
            color: #FFF;
        }

        .card2 {
            text-align: center;
            border-radius: 11px;
            background: #1D2D9D;
            color: #FFF;
            padding: 20px;
            margin: 15px;
        }

        .cardGrup {
            display: flex;
            justify-content: center;
            gap: 10px;
        }

        .content,
        gridContainer {
            width: 100% !important;
            margin: 0;
            padding: 0;
            box-sizing: unset !important;
        }

        .flex {
            display: flex;
        }

        .h0 {
            font-size: 100px;
        }

        .input {
            width: 97%;
            border: #8E8E8E solid 1px;
            margin-bottom: 5px;
        }

        .inner-header-description {
            display: none;
        }

        .linksFooter {
            color: #8E8E8E;
            text-decoration: none;
        }

        .linksFooterBox {
            border-right: #D9D9D9 solid 2px;
            padding-right: 10px;
            padding-left: 10px;
        }

        .MobBlock,
        .MobFlex {
            display: none !important;
        }

        .w20 {
            width: 20%;
        }

        .w50 {
            width: 50%;
        }

        .logoAnimR {
            animation-name: logoInR;
            animation-duration: 0.5s;
            animation-fill-mode: forwards;
        }

        @keyframes logoInR {
            0% {
                transform: translateX(100%);

            }

            to {
                transform: translateX(0px);

            }
        }

        .logoAnimL {
            animation-name: logoInL;
            animation-duration: 0.5s;
            animation-fill-mode: forwards;
        }

        @keyframes logoInL {
            0% {
                transform: translateX(-100%);

            }

            to {
                transform: translateX(0px);

            }
        }

        #page-top,
        .heateor_sss_sharing_container,
        .footer-contact-boxes {
            display: none;
        }

        #page-content,
        .page-content {
            padding: 0 !important;
            margin: 0;
        }

        @media (max-width: 500px) {
            .block {
                display: flex;
            }

            .btnB {
                padding: 10px;
            }

            .card {
                margin: auto;
                margin-bottom: 20px;
            }

            .cardGrup {
                display: block;
            }

            .linksFooterBox {
                margin: 15px 0;
            }

            .MobBlock {
                display: block !important;
            }

            .MobFlex {
                display: flex !important;
            }

            .MobNone {
                display: none !important;
            }

            .flex {
                display: block;
            }

            .h0 {
                font-size: 40px;
            }

            .textCenter {
                text-align: center;
            }

            .w20 {
                width: auto;
            }

            .w50 {
                width: auto;
            }

            h1 {
                font-size: 18px;
            }

            h3 {
                font-size: 15px;
            }

            h4 {
                font-size: 14px;
            }

            h5 {
                font-size: 13px;
            }


        }
    </style>
